script: |
  super -f text -I q10915.spq | sort > q10915.out

inputs:
  - name: q10915.spq
    data: |
      SELECT ALL ( + 58 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 + - + 78 + - + 4 * - col2 IN ( - 72 * + + col1 * + col2, - col2 / col2 / + 1 );
  - name: tab0

outputs:
  - name: q10915.out
    data: |
      58
      58
      58
